import React, { useState } from "react";
import { Button } from "@material-ui/core";
const UserSignUp = () => {
	const [signUpInput, setSignUpInput] = useState({
		name: "",
		email: "",
		password: ""
	});
	return (
		<div>
			<form onSubmit={null}>
				<input
					type="text"
					placeholder="Name"
					name="name"
					value={null}
					onChange={null}
				/>
				<input
					type="text"
					placeholder="Email"
					name="email"
					value={null}
					onChange={null}
				/>
				<input
					type="text"
					placeholder="Password"
					name="password"
					value={null}
					onChange={null}
				/>
				<Button type="submit">Login</Button>
			</form>
		</div>
	);
};

export default UserSignUp;
